                            "DetailedDescription": "Параметр представляет собой массив, содержащий 100 элементов. Некоторые элементы массива не используются (зарезервированы). Элементы массива связаны со списком возможных диагностических сообщений (см. табл. 10.1 руководства по эксплуатации), которые может формировать прибор по результатам контроля собственного состояния, состояния датчиков и параметров потока измеряемой среды. Если некоторому возможному сообщению сопоставлен 0 в соответствующем элементе параметра 013, то это сообщение никогда не формируется, если 1 – то сообщение формируется при наступлении контролируемого события. Изменяя значения элементов массива, можно управлять возможностью формирования тех или иных сообщений. Значением того или иного элемента является строка из 1 символа - управление общесистемными сообщениями, из 8 символов - управление сообщениями по магистралям, из 16 символов - управление сообщениями по трубопроводам. Символами в строке могут быть только 0 и 1. Например, элемент 013н62 управляет формированием сообщения о том, что расход по трубопроводу стал меньше отсечки самохода. Это сообщение (013н62=0000000000000000) по умолчанию не формируется, но при необходимости его можно включить, например, по второму трубопроводу: 013н62=01000000000000. Значения по умолчанию элементов массива 013 приведены в таблице 10.1 руководства по эксплуатации.",
