                    "DetailedDescription": "Первая цифра определяет вывод на печать сообщений о нештатных ситуациях (НС, см. параметр 013), вторая зарезервирована, третья и четвертая задают периодичность печати отчетов по трубопроводам и по потребителям. Если первая цифра равна 0, то печать сообщений о НС не производится, если равна 1, то печать производится по факту возникновения (исчезновения) НС. Если третья и/или четвертая цифра равна 0 - не печатаются отчеты по трубопроводам и/или потребителям; если равна 1, то производится печать отчетов по соответствующему трубопроводу или потребителю за каждые расчетные сутки, 2 - производится печать отчетов за каждый расчетный месяц, 3 - производится печать и за каждые расчетные сутки и за каждый расчетный месяц. Если пятая цифра равна 1, то учетные данные записываются в архив с признаком \"получены при наличии нештатной ситуации\" (данные помечаются символом *) при условии, что одна или несколько нештатных ситуаций возникали в течение соответствующего часа; если пятая цифра равна 0, то при записи в архив данные символом * не маркируются. Шестая цифра управляет подачей бумаги: 1 – печать с переводом страниц, 0 - печать на рулонную бумагу без перевода страниц. Цифра 7 зарезервирована и равна 0. Цифры 9 и 10 цифры определяют скорость реакции прибора на возникновение НС. Значение по умолчанию 0000000010.",
