                            "DetailedDescription": "Параметр представляет собой массив, содержащий до 100 элементов. Правила формирования списка приведены в руководстве по эксплуатации. Эти же правила распространяются и на другие списки, описанные в руководстве. Формируемый по умолчанию список Сп1 приведен в таблице 5.1 руководства по эксплуатации и включает параметры, значения которых приходится изменять в процессе эксплуатации тепловычислителя при включенной защите данных. Если значение задано, то перед изменением значений параметров, включенных в список, прибор запрашивает пароль. Значение параметра представляет собой строку длиной до 6 знаков, которая может включать цифры и символы \"-\" (минус), \".\" (точка), \"Е\". Значение пароля может быть выведено и изменено только при выключенной защите данных в режиме формирования списка. Отключение запроса пароля производится при вводе одного символа \"-\". При изменении данных по интерфейсам RS232 и RS485 нужно передать прибору сначала значение пароля (\"записать\" пароль), а потом передавать данные. Если перерыв в передаче данных более 2 минут, нужно заново ввести пароль.",
