                    "TagName": "X т04",
                    "MeasurementUnit": null,
                    "Description": "Степень сухости насыщенного пара",
                    "Address": "105т4",
                    "DetailedDescription": "Определяется как отношение массы газовой фазы теплоносителя к общей массе. Для сухого насыщенного пара значение параметра равно 1. Четких рекомендаций по определению коэффициента сухости нет. Можно исходить из соображений равенства массы теплоносителя на отпускающей стороне и у потребителя. Параметр используется, если теплоноситель - насыщенный пар. Значение по умолчанию равно 1.",
                    "ValueRange": "0…1",
                    "Ordinal": 105,
                    "Kind": "Tag"
