                            "Address": "109н01т5",
                            "DetailedDescription": "Значением параметра может быть 0; 1; 100 или строка из пяти цифр, указывающая на номер измерительного канала для датчика расхода. При этом 0 означает, что датчик отсутствует и отсутствующий датчик является датчиком объемного расхода; 1 означает, что датчик отсутствует и отсутствующий датчик является датчиком массового расхода; 100 означает, что информация о расходе поступает от внешнего источника, например, по компьютерной сети. Первые три цифры слева задают ссылку на номер параметра, описывающего датчик; здесь это либо 032 (датчик с токовым выходным сигналом), либо 034 (датчик с выходным импульсным сигналом); две последние цифры указывают номер измерительного канала, которому соответствует датчик. Значение по умолчанию равно 0.",
