                            "DetailedDescription": "Значением параметра может 0 или строка из четырех цифр (например, 1501), указывающая номер контролируемого параметра (здесь, например, 150) и правило формирования диагностического сообщения (здесь, например, 1). Диагностические сообщения записываются в архив нештатных ситуаций, если это задано в параметре 013. При этом, если значение равно 0, то уставка не назначена; если последняя (четвертая слева) цифра равна 1, то уставка задана и диагностическое сообщение формируется тогда, когда значение измеряемого параметра становится больше значения уставки; если последняя цифра равна 2, то уставка задана и диагностическое сообщение формируется тогда, когда значение измеряемого параметра становится меньше уставки. Специфическое применение рассматриваемой уставки заключается в том, что она используется для контроля максимально допустимого расхода. Если задано 131т*н00=1571, то при выходе значения расхода за уставку вычисляется и архивируется время работы tmax при расходе больше максимального (параметры 420п* - 422п*) по тем потребителям, которые включают трубопровод т*. Значение по умолчанию равно 0.",
