                    "DetailedDescription": "Значение параметра – строка из двух цифр: первая относится к первому дополнительному датчику, назначенному как двухпозиционный, вторая - ко второму. Если цифра 0, то изменение состояния соответствующего датчика двухпозиционного сигнала просто отражается в архиве сообщений о нештатных ситуациях; если цифра 1, то сигнал датчика используется в алгоритме обработки перерывов питания: после восстановления питания анализируется состояние датчика и если его сигнал больше нуля, то это интерпретируется как факт перекрытия трубопровода при отключении питания и на время перерыва питания константа массового расхода принимается равной нулю; если цифра 2, то сигнал датчика интерпретируется как сигнал о направлении потока теплоносителя и при сигнале больше нуля производится вычисление объема и массы теплоносителя транспортированного по трубопроводу в прямом направлении; если цифра 3, то сигнал датчика также интерпретируется как сигнал о направлении потока теплоносителя, но вычисление объема и массы теплоносителя по трубопроводу производится при сигнале равном нулю (реверсное направление потока). Значение по умолчанию 00.",
                    "ValueRange": "00, 10, 01, 20, 02, 03, 30",
                    "Ordinal": 124,
                    "Kind": "Tag"
