                            "Description": "Значение ширины зоны гистерезиса для уставки",
                            "Address": "311н01п3",
                            "DetailedDescription": "Если значение измеряемого параметра близко к уставке, то возможны частые выходы за уставку и возврат обратно в силу случайных причин. Для исключения частого формирования диагностических сообщений вводится гистерезис так, чтобы сообщение формировалось при выходе за уставку, а снималось при значении измеряемого параметра равном \"уставка минус гистерезис\". Значение по умолчанию равно 0.",
