                    "Description": "Идентификатор потребителя",
                    "Address": "300п7",
                    "DetailedDescription": "Каждой магистрали (потребителю) может быть присвоен номер по классификации пользователя. При необходимости вводится как целое число длиной до 6 знаков. Значение по умолчанию равно 0.",
                    "ValueRange": "0…999999",
